sys_variable_value.value:
(function execute(inputs, outputs) {
	if (inputs.status_code == "200") {
		outputs.status = "Success";
		var response = JSON.parse(inputs.response);
		var payload = response.OptionSet.Options;
		var tables = {
			data: []
		};
		payload.map(function(item) {
			tables.data.push({
				"name": item.Value,
				"label": (typeof item.Label.LocalizedLabels[
						0] == 'undefined' ? item
					.LogicalName : item.Label
					.LocalizedLabels[0].Label)
			});
		});
		outputs.tables = tables;
	} else
		outputs = new MicrosoftDynamicsCRMErrorHandler()
		.getFieldChoiceListErrorHandler(inputs, outputs);
})(inputs, outputs);

